sys_script_include.script:
var GettheCountryInfo = Class.create();
GettheCountryInfo.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {
    getCountryInfo: function() {
        var GettheCountryInfo = this.getParameter('sysparm_personName');

        try {
            var countryReq = new sn_ws.RESTMessageV2('x_843001_name_gend.nationalize', 'GettheCountryInfo');
            countryReq.setStringParameterNoEscape('name', GettheCountryInfo);



			var responseCountry = countryReq.execute();
            var responseBodyCountry = responseCountry.getBody();
			var parsedBodyCountry = JSON.parse(responseBodyCountry);
            var httpStatusCountry = responseCountry.getStatusCode();

			return JSON.stringify({"country":parsedBodyCountry});

        } catch (ex) {
            var message = ex.message;
        }

    },

    type: 'GettheCountryInfo'
});
